import React from "react";
import { Link } from "react-scroll";
import Dropdown from './Dropdown/Dropdown'
import './menu.css'
import Fresh from './Fresh/Fresh'
import Fillet from './Fillets/Fillet'

function Menu() {
	return (
		<body className="Site-content">	

			<header className="fixedNav">
				
			<Dropdown/>
			<div className="fnBar"></div></header>
			<main>
			
			<Fresh></Fresh>
			</main>
		</body>
	);
}
export default Menu;
